Solidity appends CBOR metadata to all contracts that it compiles by default. The CBOR metadata includes an IPFS hash of the source code used to build the bytecode and some other metadata. As I understand the CBOR metadata is a "Solidity thing" NOT an "EVM thing". I.e. if I were to move the pc into the metadata with a jump and it landed at a valid jump destination then the EVM, knowing nothing about CBOR metadata, would happily run the bytes of the metadata as EVM opcodes. To test this I wrote a script that brute forces IPFS hashes by modifying comments in the source code until it finds an IPFS hash that contains the 2-byte sequence 0x5bff which is JUMPDEST SELFDESTRUCT. For example, our deployed bytecode might look like:  Where the final bytes are CBOR metadata: a2
64 69706673 5822 1220748a4af9208c7ac7d2d439e7ae39963e9d9825504480f252df41db0bb35bff65
64 736f6c63 43 000812
00 33 Encoding reference: https://docs.soliditylang.org/en/v0.8.19/metadata.html#encoding-of-the-metadata-hash-in-the-bytecode Note the 0x5bff near the end of the IPFS hash. The only thing we need anywhere in our contract to jump to the IPFS hash is function() f;
assembly { f := _pc }
f(); Where _pc is the byte offset of the jump destination embedded in the IPFS hash. _pc is just a uint256, it can come from anywhere, calldata, storage, hardcoded, etc. Normally this little snippet can be very powerful and useful. For example, I've used this to implement an onchain interpreter . But it is dangerous if there are any jump destinations that it can reach that you didn't expect.
